package javapack;

public class Whileloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int  a =5;
		int b =10;
		
		/*
		 * while(a<b) {
		 * 
		 * System.out.println("while script");
		 * 
		 * a++; }
		 */

	do {
		System.out.println("script");
		
		a++;
	}while(a<b);
	
	
	
	
	
	}

}
